SET @OGUID := 6000000;
SET @EVENT := 8;

-- Drop old spawns
DELETE FROM `gameobject` WHERE `guid` BETWEEN @OGUID+13 AND @OGUID+172;
DELETE FROM `game_event_gameobject` WHERE `eventEntry`=@EVENT AND `guid` BETWEEN @OGUID+0 AND @OGUID+170;

DELETE FROM `gameobject` WHERE `guid` BETWEEN @OGUID+0 AND @OGUID+159;

DELETE FROM `game_event_gameobject` WHERE `eventEntry`=@EVENT AND `guid` BETWEEN @OGUID+0 AND @OGUID+157;
